def getvalue(link):
    r = requests.get(link)
    soup = BeautifulSoup(r.content, "lxml")

    base_url = "https://whattomine.com"
    for link in soup.find_all("a", text = "Ethereum(ETH)"):
        subparent1 = link.parent
        subparent2 = subparent1.parent
        row = subparent2.parent

    data = []
    cols = row.find_all('td')
    cols = [ele.text.strip() for ele in cols]
    data.append([ele for ele in cols if ele])

    preco = data[0][3].split()

    return preco

def worker(cell, link):
    thisval = getvalue(link)
    Wsheet(thisval[1],cell)

